import { Navigate, Route, Routes } from "react-router-dom";
import Postad from "../../pages/Sellingpage/Postad";
import SignupPage from "../../pages/SignUpPage";
import { useState } from 'react';
import HomePage from "../../pages/HomePage";
import Login from "../Loginthingys/Login";
import Ads from "../../pages/Ad Page/Ads";

const Navigation = () => {
	const user = true;
	return (
		<>
			<Routes>
				<Route path="/ads">
					<Route path=":id" element={<Ads />} />
				</Route>
				<Route path="/" element={<HomePage user={user} />} />
				<Route path="/ads/post-ad" element={<Postad />} />
				<Route path="/login" element={user ? <HomePage user={user} /> : <HomePage user={!user} />} />
				<Route path="/signup" element={<SignupPage />} />
			</Routes>
		</>
	);
};

export default Navigation;
